### C++`<<`

C++`<<`****`std::cout`

#### 1. `<<`
`<<``std::cout`
```cpp
#include <iostream>
int main() {
    std::cout << "Hello, World!" << std::endl;
    return 0;
}
```
`<<``"Hello, World!"``std::cout`

#### 2. `<<`
`<<``<<`
```cpp
std::ostream& operator<<(std::ostream& os, const MyClass& obj) {
    os << obj.some_member; // MyClasssome_member
    return os;
}
```
- `std::ostream&`
- `const MyClass&`
- `std::ostream&`


```cpp
#include <iostream>
class MyClass {
public:
    int value;
    MyClass(int v) : value(v) {}
};

std::ostream& operator<<(std::ostream& os, const MyClass& obj) {
    os << "MyClass value: " << obj.value;
    return os;
}

int main() {
    MyClass obj(42);
    std::cout << obj << std::endl; // : MyClass value: 42
    return 0;
}
```
#### 3. 
C++**Stream** `std::cin``std::cout`

