Buffer

#### 4. `<<`
`<<`C++`std::cout << obj``std::ostream``MyClass``operator<<`


```cpp
std::cout << obj;
```

```cpp
operator<<(std::cout, obj);
```
`operator<<`

#### 5. 
`operator<<``std::ostream&`
```cpp
std::cout << "Value: " << 42 << std::endl;
```

```cpp
operator<<(operator<<(operator<<(std::cout, "Value: "), 42), std::endl);
```
`operator<<``std::cout``operator<<`

